import { useState, useEffect } from "react";

const CourseList = () => {
  const [courses, setCourses] = useState([]);

  useEffect(() => {
    fetch("/api/courses/")
      .then((response) => response.json())
      .then((data) => {
        setCourses(data);
        console.log(data);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div>
      <h1>Course List</h1>
      {courses &&
        courses.map((course) => (
          <ul>
            <li>Title</li>
            <li>Description</li>
            <li>Instructor</li>
            <li>Duration</li>
            <li>Available Slot</li>
          </ul>
        ))}
    </div>
  );
};

export default CourseList;
